import React from 'react';

const Currency = (props) => {
  return (
    <div>
      <div className="col-3 border-bottom media m-2 h-30">
        <img
          src="http://placeimg.com/64/64/tech"
          className="d-lg-block mr-2"
          style="max-width: 100%; height: 28px"
          alt="square"
        />
        <div className="media-body">Flex item 0</div>
        <div className="align-text-right">24%</div>
      </div>
    </div>
  );
};

export default Currency;
